import React from 'react';
import './Product.css';

const Product = (props) => {
    const {img,price,name,seller,quantity,ratings} = props.product;
    return (
        <div className='product'>
            <img src={img} alt="" />
            <h6 className='product-name'>{name}</h6>
            <h6>Price: ${price}</h6>
            <p>Manufacturer: {seller}</p>
            <p>Rating: {ratings}</p>
        </div>
    );
};

export default Product;
